import React from 'react';
import ReactDOM from 'react-dom';
import {
    Route,
    Switch
} from 'react-router-dom';
import ListBookTiki from './ListBookTiki'
import ListBookTikiProduct from './ListBookTikiProduct'

class RouterURL extends React.Component {
    render() {
        return (
            <div>
                <Switch>
                <Route exact path="/listBookTiki" component = {ListBookTiki} />
                <Route exact path="/listBookTikiProduct" component = {ListBookTikiProduct} />
                </Switch>
            </div>
        )
    }
}

export default RouterURL;
